import {
  IndividualCard,
  ImageWrapper,
  ProductImage,
  ParaTag,
  HeadingTag,
} from "./styles";

import { FaStar } from "react-icons/fa";

function SearchDisplay({ id, name, brand, price, rating, image }: any) {
  if(name==='' && brand==='' && price===0 && rating===0 && image===''){
  return(
    <div>no products</div>
  )}
  else{
  return (
    <IndividualCard>
      <ImageWrapper>
        <ProductImage src={image} />
      </ImageWrapper>
      <HeadingTag>{name}</HeadingTag>
      <ParaTag>Brand:{brand}</ParaTag>
      <ParaTag>${price}</ParaTag>
      <ParaTag>
        <FaStar /> {rating}
      </ParaTag>
    </IndividualCard>
  );
}}
export default SearchDisplay;
